import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { AuthService } from '../_services/auth.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-registration',
  templateUrl: './registration.component.html',
  styleUrls: ['./registration.component.css']
})
export class RegistrationComponent {

RegForm! : FormGroup;
submitted = false;


  constructor( private fg : FormBuilder, private auth : AuthService, private router: Router){}

ngOnInit(): void{
  this.RegForm = this.fg.group({
   LastName : ['', Validators.required],
   FirstName : ['', Validators.required],
   UserName : ['', Validators.required],
   Email : ['', Validators.required],
   Password : ['', Validators.required],
  })
}

get f() { return this.RegForm.controls; }

onRegistration(){
  if(this.RegForm.valid){
    this.auth.signUp(this.RegForm.value)
    .subscribe({
      next:(res=>{
        alert(res.message);
        this.RegForm.reset();
        this.router.navigate(['welcome'])
      })
      ,error:(err=>{
        alert(err?.error.message)
      })      
    })


    console.log(this.RegForm.value)
  }else{
    alert("something wrong22")
    // ValidateForm.validateAllFormFields(this.RegForm)

  }

}

}
<form [formGroup]="RegForm" (ngSubmit)="onRegistration()">


    <div class="row">
        <div class="form-group mb-3">
            <label class="mb-2">FirstName</label>
            <input type="text" formControlName="FirstName" class="form-control"
            [ngClass]="{ 'is-invalid': submitted && f['FirstName'].errors }" />

            <div *ngIf="submitted && f['FirstName'].errors" class="invalid-feedback">
                <div *ngIf="f['FirstName'].errors">FirstName is required</div>
            </div>

        </div>
    </div>

    <div class="row">
        <div class="form-group mb-3">
            <label class="mb-2">LastName</label>
            <input type="text" formControlName="LastName" class="form-control"
            [ngClass]="{ 'is-invalid': submitted && f['LastName'].errors }" />

            <div *ngIf="submitted && f['LastName'].errors" class="invalid-feedback">
                <div *ngIf="f['LastName'].errors">LastName is required</div>
            </div>

        </div>
    </div>

    <div class="row">
        <div class="form-group mb-3">
            <label class="mb-2">UserName</label>
            <input type="text" formControlName="UserName" class="form-control"
            [ngClass]="{ 'is-invalid': submitted && f['UserName'].errors }" />

            <div *ngIf="submitted && f['UserName'].errors" class="invalid-feedback">
                <div *ngIf="f['UserName'].errors">UserName is required</div>
            </div>

        </div>
    </div>

    <div class="row">
        <div class="form-group mb-3">
            <label class="mb-2">Email</label>
            <input type="text" formControlName="Email" class="form-control"
            [ngClass]="{ 'is-invalid': submitted && f['Email'].errors }" />

            <div *ngIf="submitted && f['Email'].errors" class="invalid-feedback">
                <div *ngIf="f['Email'].errors">Email is required</div>
            </div>

        </div>
    </div>

    <div class="row">
        <div class="form-group mb-3">
            <label class="mb-2">Password</label>
            <input type="text" formControlName="Password" class="form-control"
            [ngClass]="{ 'is-invalid': submitted && f['Password'].errors }" />

            <div *ngIf="submitted && f['Password'].errors" class="invalid-feedback">
                <div *ngIf="f['Password'].errors">Password is required</div>
            </div>

        </div>
    </div>




    <button type="submit" class="btn btn-success me-3">Submit</button>

</form>
